export  default  class RouterApp extends Component{

render() {
return (
    <BrowserRouter>
        // <div>
          <Route exact path = {'/'} component = {() => <Login/>} />
        //  <Route exact path = {'/login'} component = {() => <StudentLogin/>} />
        // </div>
    </BrowserRouter>
);
}


